import React, { Component } from 'react';
import './header.css';

export class Header extends Component {
  render() {
    return (
      <div className='header'>
            <div style={{display:'flex', flexDirection:'row', margin:'0 auto', background:'red'}}>
              <h1>Logo</h1> 
              <ol style={{display:'flex', flexDirection:'row'}}>
                <li>Home</li>
                <li>Blog</li>
                <li>About</li>
                <li>Contact</li>
              </ol>
            </div>

      </div>
    )
  }
}

export default Header
